import { useState,useEffect } from "react"
import React from 'react'
import axios from 'axios'
import { useNavigate } from "react-router-dom"

function SignUp() {

    const [users, setUsers] = useState([])
    const [email, setEmail] = useState('')
    const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')
    const navigate = useNavigate();

    useEffect(() => {
      
        fetchUsers();

    }, [])

    const fetchUsers  = () => {
        axios 
        .get('http://localhost:3001/register')
        .then((res) => {
            console.log(res.data)
        })
    }
    
    const handleRegister = (event) => {
        event.preventDefault()
        axios
        .post('http://localhost:3001/register', { email, username, password})
        .then( () => {
            alert('Registration Succesful')
            setEmail('')
            setUsername('')
            setPassword('')
            fetchUsers()
            navigate('/login')
        })
        .catch((error) => {
            console.log('Unable to register')
        })
    }
    


  return (
    <div className='w-full h-screen flex'>
        <div className='w-full h-[100%] bg-slate-100 text-white flex justify-center items-center'>
            <form className='text-center border rounded-lg w-[600px] h-[400px] p-9 bg-[#635fc7]'
            onSubmit={handleRegister}>
                
                {/* EMAIL INPUT */}
                <label>Email</label>
                <br/>
                <input className='w-[400px] rounded-xl bg-zinc-700 p-2'
                type='text'
                placeholder='Email'
                value={email}
                onChange={(e) => setEmail(e.target.value)}/>
                <br/>
                <br/>
                {/* USERNAME INPUT */}
                <label>Username</label>
                <br/>
                <input className='w-[400px] rounded-xl bg-zinc-700 p-2'
                type='text'
                placeholder='Username'
                value={username}
                onChange={(e) => setUsername(e.target.value)}/>
                <br/>
                <br/>
                {/* PASSWORD INPUT */}
                <label>Password</label>
                <br/>
                <input className='w-[400px] rounded-xl bg-zinc-700 p-2'
                type='password'
                placeholder='Password'
                value={password}
                onChange={(e) => setPassword(e.target.value)}/>
                <br/>
                <br/>
                {/* BUTTON */}
                <button className='w-[200px] h-[50px] border hover:bg-teal-900'
                type='submit'>SIGN UP</button>
            </form>
        </div>
        
    </div>
  )
}

export default SignUp
